import React from 'react';
import { Card } from 'antd';
import 'antd/dist/antd.css'; // Import Ant Design styles

const cardData = [
  { title: 'Title 1', image: 'image1.jpg' },
  { title: 'Title 2', image: 'image2.jpg' },
  { title: 'Title 3', image: 'image3.jpg' },
  { title: 'Title 4', image: 'image4.jpg' },
  { title: 'Title 5', image: 'image5.jpg' },
  { title: 'Title 6', image: 'image6.jpg' },
  { title: 'Title 7', image: 'image7.jpg' },
  { title: 'Title 8', image: 'image8.jpg' },
  { title: 'Title 9', image: 'image9.jpg' },
];

const ColBox = () => {
  return (
    <div style={{ display: 'grid', gridTemplateColumns: 'repeat(3, 1fr)', gap: '20px', padding: '20px' }}>
      {cardData.map((card, index) => (
        <Card
          key={index}
          hoverable
          style={{ width: 300 }}
          cover={<img alt={`Image ${index}`} src={card.image} />}
        >
          <Card.Meta title={card.title} />
        </Card>
      ))}
    </div>
  );
};

export default ColBox;
